import React from 'react';
import './App.css';
import { Card } from './components/Card/Card';
import Body from './components/Body/Body';

function App() {
  return (
    <div className='grid justify-items-stretch grid-cols-1 laptop:grid-cols-3'>
      <div>
        <Card />
      </div>
      <div className='laptop:col-span-2'>
        <Body />
      </div>
    </div>
  );
}

export default App;
